const cardList = [
  {
    name: "Bush",
    filePath: "cardImages/card1.png"
  },
  {
    name: "Angel",
    filePath: "cardImages/card2.png"
  },
  {
    name: "Water Thing",
    filePath: "cardImages/card3.png"
  }
];

export function generateRandomDefaultCard() {
  return cardList[Math.floor(Math.random() * cardList.length)];
}

export default cardList;
